INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 3001100, "ヤマト", 2, 1, 130011, -416.5, 2.1, 3001);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 3001101, "ヤマト", 2, 4, 130011, -416.5, 5.68, 3001);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 3001102, "ヤマト", 1, 1, 130011, -416.5, 0.0, 3001);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 3002100, "フブキ", 1, 1, 130211, -416.5, 0.0, 3002);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 3002101, "フブキ", 1, 1, 130211, -416.5, 0.0, 3002);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 3002102, "フブキ", 2, 5, 130211, -416.5, 8.53, 3002);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 3002103, "フブキ", 1, 7, 130211, -416.5, 5.67, 3002);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 3002104, "フブキ", 1, 1, 130211, -416.5, 0.0, 3002);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (300, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 3002300, "フブキ", 3, 3, 130211, -416.5, 0.0, 3004);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (301, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 3002400, "フブキ", 7, 7, 130211, -416.5, 0.0, 3005);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (200, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 3003200, "フブキ", 1, 2, 130211, -416.5, 4.4, 3003);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (201, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 3003201, "フブキ", 7, 7, 130211, -416.5, 0.0, 3003);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (202, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 3003202, "フブキ", 2, 1, 130211, -416.5, 5.6, 3003);
